import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="./paginas/Notas">Notas</Link>
          </li>
          <li>
            <Link to="./Pagina/Timeline">Timeline</Link>
          </li>
        </ul>
      </nav>
      <Outlet />
    </div>
  );
};

export default Layout;
